public void run()
{
    double delta = timer.getDeltaTime();
    double toWait = (smoothing + delta) / 2;
    smoothing = delta;

    toWait = (2 / targetFPS) - toWait;

    if (toWait > 0)
    {
        long ms = (long) (toWait * 1000);
        int ns = (int) ((toWait % 0.001) * 1.0e+9);

        sleep(ms, ns);
    }
}
